//新消息、来电提示

var msg_in = anime({
    translateX: [320, 0],
    duration: 600,
    easing: 'easeOutQuad',

});

//提示相关关闭效果

var close_flip = anime({
    opacity: 0,
    rotateX: 90,
    marginTop: 0,
    marginBottom: 0,
    height: {
        value: 0,
        delay: 400,
        duration: 200,
        easing: 'easeOutQuad',
    },
    duration: 400,
    easing: 'easeOutQuad',
});


//纵向导航等list顺序展现

var list_left_fade_in = anime({
    translateX: [-10, 0],
    opacity: [0, 1],
    delay: function(el, index) {
        return index * 50;
    },
});



var fade_in = anime({
    //targets: '.mask-in',
    opacity: [0, 1],
    duration: 400,
    easing: 'easeOutQuad',
    autoplay: false
});

var fade_out = anime({
    //targets: '.mask-in',
    opacity: [1, 0],
    duration: 400,
    easing: 'easeOutQuad',
    autoplay: false
});



/*右侧滑出弹出层*/
var slider_in = anime({
    translateX: ['100%', '0%'],
    duration: 400,
    easing: 'easeOutQuad',
});

var slider_out = anime({
    translateX: ['0%', '105%'],
    duration: 400,
    easing: 'easeOutQuad',
});



/*toast*/
var toast_in = anime({
    //targets: '.toast',
    scale: [1.15, 1],
    translateY: ['-50%', '-50%'],
    translateX: ['-50%', '-50%'],
    opacity: [0, 1],
    //delay: 2000,
    autoplay: false,
    complete: function() {
        anime({
            targets: this.targets,
            duration: 600,
            delay: 1000,
            scale: [1, .8],
            translateY: ['-50%', '-50%'],
            translateX: ['-50%', '-50%'],
            easing: 'easeInOutExpo',
            opacity: [1, 0],
            complete: function() {
                this.targets.style.display = 'none'
            }
        });
    }
});


/*顶部系统提示*/
var top_alert_in = anime({
    //targets: '.top-alert',
    duration: 400,
    translateY: ['-100%', '0%'],
    translateX: ['-50%', '-50%'],
    easing: "easeInOutCubic",
    complete: function() {
        anime({
            targets: this.targets,
            duration: 400,
            delay: 3000,
            translateY: ['0%', '-100%'],
            translateX: ['-50%', '-50%'],
            easing: "easeInOutCubic",
        })
    }

});

/*弹出窗相关*/
var lightbox_in = anime({
    //targets: this_lightbox,
    opacity: [0, 1],
    scale: [1.15, 1],
    easing: 'easeInOutCubic',
    duration: 400,
});

var lightbox_out = anime({
    //targets: this_lightbox,
    opacity: [1, 0],
    scale: [1, .8],
    easing: 'easeInOutCubic',
    duration: 400,
    
});
